import React from "react";
import { Link } from "react-router-dom";
import "./AdminHomePage.css";

const HeroSection = () => {
    return (
        <header className="hero">
            <div className="hero-content">
                <h1 className="hero-title">Your Comfort Awaits, Reserve Now</h1>
                <p className="hero-subtitle">
                    Make seat reservations simple and straightforward.
                </p>
                <div className="hero-button">
                    <div className="manage-booking-link">
                        <B to="./bookyourseat" className="AdminHomePage-btn-text">
                            Manage Booking
                        </B>
                        {/* <Link to="./bookyourseat" className="AdminHomePage-btn-text">
                            Manage Booking
                        </Link> */}
                        <Link to="./bookyourseat" className="AdminHomePage-btn-text">
                            Manage Booking
                        </Link>
                    </div>
                    <div className="manage-seat-link">
                    <Link to="./bookyourseat" className="AdminHomePage-btn-text">
                        Manage Seat
                    </Link>
                    </div>
                </div>
                <div id="wrapper">
                    <div id="wrapper-inner">
                        <div id="scroll-down">
                            <span class="arrow-down"></span>
                            <span id="scroll-title">Scroll down</span>
                        </div>
                    </div>
                </div>
            </div>
        </header>
    );
};

const AdminHomePage = () => {
    return (
        <div className="content whole-body-AdminHomePage">
            <HeroSection />
        </div>
    );
};

export default AdminHomePage;
